  to 13 meters during February 2001 - February 2002. The USGS team collected hourly
  significant wave height and dominant wave period data with the gauges and they provided
  the data in an ASCII format.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
